$_MODULE['<{fcpayone}prestashop>translations_d4b3ffe1ae5d057660802fe4b8050ef2'] = 'Sie suchen nach der optimalen Payment-Lösung für Ihren Online-Shop?<br />PAYONE bietet Unternehmenslösungen zur automatisierten und ganzheitlichen Abwicklung aller Zahlungsprozesse im E-Commerce. Der Payment Service Provider ist ein Unternehmen der Sparkassen-Finanzgruppe und von der Bundesanstalt für Finanzdienstleistungsaufsicht als Zahlungsinstitut zugelassen. Das Leistungsspektrum umfasst die Akzeptanz und Abwicklung nationaler und internationaler Zahlungsarten sowie alle Zahlungsdienstleistungen. Standardisierte Schnittstellen und Extensions erlauben eine einfache Integration in bestehende E-Commerce und IT-Systeme bei höchsten Sicherheitsstandards.Hier finden Sie weitere Informationen zum PAYONE Payment-Modul für PrestaShop: https://www.payone.de ';
